import React from "react";

function Register() {
  return (
    <div>
      <div className="flex">
        <form action="">
          <label htmlFor="name">Name:</label>
          <input type="text" />
          <label htmlFor="email">Email:</label>
          <input type="text" />
          <label htmlFor="password">Password</label>
          <input type="password" />
          <label htmlFor="confirm-password">Confirm Password:</label>
          <input type="password" />
        </form>
      </div>
    </div>
  );
}

export default Register;
